    def predictPartyVictory(self, senate: str) -> str:
        N = len(senate)
        rq = deque()
        dq = deque()
        for i, v in enumerate(senate):
            if v == 'R':
                rq.append(i)
            else:
                dq.append(i)
        while len(rq) > 0 and len(dq) > 0:
            if rq[0] < dq[0]:
                dq.popleft()
                tmp = rq.popleft()
                rq.append(tmp + N)
            elif dq[0] < rq[0]:
                rq.popleft()
                tmp = dq.popleft()
                dq.append(tmp + N)
        if len(rq) > 0:
            return 'Radiant'
        else:
            return 'Dire'

